import { Box, Button } from "@mui/material"
import './header.css'
import FilterAltIcon from '@mui/icons-material/FilterAlt';
const Header=()=>{


    return(
        <Box>
            <Box className="filter-btn-box">
            <Button className="filter-btn" startIcon={FilterAltIcon}>
                Filter
            </Button>
            </Box>
        </Box>
    )
}
export default Header
